        public List<Track> getRecentTracks(string user, string from)
        {
            string request = "?method=user.getRecentTracks&user=" + user + "&from=" + from + this.apiKey + "&format=json";
            Recenttracks recent = getRecentTrackList(request);
            List<Track> list = new List<Track>();
            list.AddRange(recent.track);
            for (int i = 1; i < recent.attr.totalPages; ++i)
            {
                Recenttracks next = getRecentTrackList(request + "&page=" + (i + 1).ToString());
                list.AddRange(next.track);
            }
            return list;
